import React from 'react';
import styles from './TestForm.module.scss';
import { Answer, IQuestion, Result, Test } from '../../stores/testStore';
import { useForm, SubmitHandler, useFieldArray, Controller } from 'react-hook-form';

/*name: '',
description: '',
author: '',
questions: [],
results: [],
score: 0,
likes: 0,
comments: [],
createdAt: new Date(),
isUpdated: []*/

type FormValues = {
    name: string,
    description: string,
    questions: IQuestion[],
    results: Result[]
}


export default function TestForm() {
    const { register, control, handleSubmit } = useForm<FormValues>({
        mode: 'onBlur'
    });

    const { fields: questionFields, append: appendQuestion } = useFieldArray({
        control,
        name: 'questions'
    });
    const { fields: resultFields, append: appendResult } = useFieldArray({
        control,
        name: 'results'
    });

    const onSubmit: SubmitHandler<FormValues> = (data) => {
        console.log(data);
    }

    const addQuestion = () => {
        appendQuestion({
            question: '',
            answers: [
                { answer: '', points: 0 },
                { answer: '', points: 0 },
                { answer: '', points: 0 },
                { answer: '', points: 0 }
            ]
        });
    };

    return (
        <div className={styles.main}>
            <form className={styles.form} onSubmit={handleSubmit(onSubmit)}>
                <div className={styles.formGroup}>
                    <label htmlFor="name">Name</label>
                    <input type="text" id="name" {...register('name', { required: 'This field is required' })} />
                </div>

                <div className={styles.formGroup}>
                    <label htmlFor="description">Description</label>
                    <textarea id="description" {...register('description', { required: 'This field is required' })} />
                </div>

                <div className={styles.formGroup}>
                    <label>Questions</label>
                    {questionFields.map((field, index) => (
                        <div key={field.id} className={styles.nestedFormGroup}>
                            <label htmlFor={`questions[${index}].question`}>Question</label>
                            <input id={`questions[${index}].question`} {...register(`questions.${index}.question`, { required: 'This field is required' })} />

                            <label>Answers</label>
                            {field.answers.map((answer, aIndex) => (
                                <div key={aIndex} className={styles.answerGroup}>
                                    <input
                                        type="text"
                                        {...register(`questions.${index}.answers.${aIndex}.answer`, { required: 'This field is required' })}
                                        placeholder={`Answer ${aIndex + 1}`}
                                    />

                                    <select {...register(`questions.${index}.answers.${aIndex}.points`, { required: true })}>
                                        <option value="0">0</option>
                                        <option value="1">1</option>
                                        <option value="2">2</option>
                                        <option value="3">3</option>
                                    </select>
                                </div>
                            ))}
                        </div>
                    ))}
                    <button type="button" onClick={() => addQuestion()}>Add question</button>
                </div>

                <div className={styles.formGroup}>
                    <label>Results</label>
                    {resultFields.map((field, index) => (
                        <div key={field.id} className={styles.nestedFormGroup}>
                            <label htmlFor={`results[${index}].result`}>Result</label>
                            <input id={`results[${index}].result`} {...register(`results.${index}.result`, { required: true })} />

                            <label htmlFor={`results[${index}].minScore`}>Min Score</label>
                            <input type="number" id={`results[${index}].minScore`} {...register(`results.${index}.minScore`, { required: true })} />

                            <label htmlFor={`results[${index}].maxScore`}>Max Score</label>
                            <input type="number" id={`results[${index}].maxScore`} {...register(`results.${index}.maxScore`, { required: true })} />
                        </div>
                    ))}
                    <button type="button" onClick={() => appendResult({ result: '', minScore: 0, maxScore: 0 })}>Add Result</button>
                </div>

                <button type="submit">Submit</button>
            </form >
        </div>
    );
};
